":true,\"required\":false},{\"indexType\":\"text\",\"repeatable\":false,\"dataType\":\"string\",\"predefinedValue\":{\"en_US\":\"\"},\"name\":\"XMPDM_VIDEO_FIELD_ORDER\",\"localizable\":false,\"readOnly\":false,\"label\":{\"en_US\":\"metadata.XMPDM.VIDEO_FIELD_ORDER\"},\"type\":\"text\",\"showLabel\":true,\"required\":false},{\"indexType\":\"text\",\"repeatable\":false,\"dataType\":\"string\",\"predefinedValue\":{\"en_US\":\"\"},\"name\":\"XMPDM_VIDEO_FRAME_RATE\",\"localizable\":false,\"readOnly\":false,\"label\":{\"en_US\":\"metadata.XMPDM.VIDEO_FRAME_RATE\"},\"type\":\"text\",\"showLabel\":true,\"required\":false},{\"indexType\":\"text\",\"repeatable\":false,\"dataType\":\"string\",\"predefinedValue\":{\"en_US\":\"\"},\"name\":\"XMPDM_VIDEO_MOD_DATE\",\"localizable\":false,\"readOnly\":false,\"label\":{\"en_US\":\"metadata.XMPDM.VIDEO_MOD_DATE\"},\"type\":\"text\",\"showLabel\":true,\"required\":false},{\"indexType\":\"text\",\"repeatable\":false,\"dataType\":\"string\",\"predefinedValue\":{\"en_US\":\"\"},\"name\":\"XMPDM_VIDEO_PIXEL_DEPTH\",\"localizable\":false,\"readOnly\":false,\"label\":{\"en_US\":\"metadata.XMPDM.VIDEO_PIXEL_DEPTH\"},\"type\":\"text\",\"showLabel\":true,\"required\":false},{\"indexType\":\"text\",\"repeatable\":false,\"dataType\":\"string\",\"predefinedValue\":{\"en_US\":\"\"},\"name\":\"XMPDM_VIDEO_PIXEL_ASPECT_RATIO\",\"localizable\":false,\"readOnly\":false,\"label\":{\"en_US\":\"metadata.XMPDM.VIDEO_PIXEL_ASPECT_RATIO\"},\"type\":\"text\",\"showLabel\":true,\"required\":false}]}',	'json',	0,	0,	20120,	NULL,	'2018-05-17 14:04:59.831000');
INSERT INTO `ddmtemplate` (`uuid_`, `templateId`, `groupId`, `companyId`, `userId`, `userName`, `versionUserId`, `versionUserName`, `createDate`, `modifiedDate`, `classNameId`, `classPK`, `resourceClassNameId`, `templateKey`, `version`, `name`, `description`, `type_`, `mode_`, `language`, `script`, `cacheable`, `smallImage`, `smallImageId`, `smallImageURL`, `lastPublishDate`) VALUES
('c7df1331-c972-6feb-4903-4f6d16b18b01',	29202,	20152,	20116,	20120,	NULL,	20120,	NULL,	'2018-05-17 14:04:28.306000',	'2018-05-17 14:04:28.306000',	27702,	0,	29201,	'WIKI-SOCIAL-FTL',	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Social</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Sociaal</Name><Name language-id=\"hu_HU\">Kzssgi</Name><Name language-id=\"pt_BR\">Social</Name><Name language-id=\"de_DE\">Social</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Sosiaalinen</Name><Name language-id=\"ca_ES\">Social</Name><Name language-id=\"fr_FR\">Social</Name><Name language-id=\"en_US\">Social</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra los marcadores sociales y las clasificaciones para pginas wiki y sus pginas secundarias.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Geeft sociale favorieten en waarderingen van wikipagina\'s en onderliggende wikipagina\'s weer.</Description><Description language-id=\"hu_HU\">Megjelenti a kzssgi knyvjelzket s rtkelseket a wiki oldalak s gyermek oldalaik rszre.</Description><Description language-id=\"pt_BR\">Exibe marcadores sociais e avaliaes para pginas da wiki e suas pginas filhas.</Description><Description language-id=\"de_DE\">Darstellung fr Social Bookmarks und Bewertungen von Wikiseiten und deren Unterseiten.</Description><Description language-id=\"iw_IL\">         .</Description><Description language-id=\"fi_FI\">Nytt sosiaaliset kirjanmerkit ja arvostelut wikisivuilla ja niiden alisivuilla.</Description><Description language-id=\"ca_ES\">Mostra adreces d\'inters socials i classificacions per a planes del wiki.</Description><Description language-id=\"fr_FR\">Affiche les signets sociaux and les notations pour page wiki et leur pages enfants.</Description><Description language-id=\"en_US\">Displays social bookmarks and ratings for wiki pages and their child pages.</Description></root>',	'display',	NULL,	'ftl',	'<#assign\n	wikiPageClassName = \"com.liferay.wiki.model.WikiPage\"\n\n	assetRenderer = assetEntry.getAssetRenderer()\n/>\n\n<div class=\"taglib-header\">\n	<h1 class=\"header-title\">${entry.getTitle()}</h1>\n</div>\n\n<div style=\"float: right;\">\n	<@getEditIcon />\n\n	<@getPageDetailsIcon />\n\n	<@getPrintIcon />\n</div>\n\n<div class=\"wiki-body\">\n	<div class=\"wiki-info\">\n		<span class=\"stats\">${assetEntry.getViewCount()} <@liferay.language key=\"views\" /></span> |\n\n		<span class=\"date\"><@liferay.language key=\"last-modified\" /> ${dateUtil.getDate(entry.getModifiedDate(), \"dd MMM yyyy - HH:mm:ss\", locale)}</span>\n\n		<span class=\"author\"><@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(entry.getUserId(), entry.getUserName()))}</span>\n	</div>\n\n	<div class=\"wiki-content\">\n		<@liferay_ui[\"social-bookmarks\"]\n			displayStyle=\"normal\"\n			target=\"_blank\"\n			title=entry.getTitle()\n			url=viewURL\n		/>\n\n		${formattedContent}\n	</div>\n\n	<div class=\"page-actions\">\n		<div class=\"article-actions\">\n			<@getAddChildPageIcon />\n\n			<@getAttatchmentsIcon />\n		</div>\n	</div>\n\n	 <br />\n\n	<@getRatings\n		cssClass=\"page-ratings\"\n		entry=entry\n	/>\n\n	<@getRelatedAssets />\n</div>\n\n<div class=\"page-categorization\">\n	<div class=\"page-categories\">\n		<#assign viewCategorizedPagesURL = renderResponse.createRenderURL() />\n\n		${viewCategorizedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_categorized_pages\")}\n		${viewCategorizedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_ui[\"asset-categories-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewCategorizedPagesURL\n		/>\n	</div>\n\n	<div class=\"page-tags\">\n		<#assign viewTaggedPagesURL = renderResponse.createRenderURL() />\n\n		${viewTaggedPagesURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_tagged_pages\")}\n		${viewTaggedPagesURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n\n		<@liferay_ui[\"asset-tags-summary\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			portletURL=viewTaggedPagesURL\n		/>\n	</div>\n</div>\n\n<#assign childPages = entry.getChildPages() />\n\n<#if (childPages?has_content)>\n	<div class=\"child-pages\">\n		<h2><@liferay.language key=\"children-pages\" /></h2>\n\n		<table class=\"taglib-search-iterator\">\n			<tr class=\"portlet-section-header results-header\">\n				<th>\n					<@liferay.language key=\"page\" />\n				</th>\n				<th>\n					<@liferay.language key=\"last-modified\" />\n				</th>\n				<th>\n					<@liferay.language key=\"ratings\" />\n				</th>\n			</tr>\n\n			<#list childPages as childPage>\n				<tr class=\"results-row\">\n					<#assign viewPageURL = renderResponse.createRenderURL() />\n\n					${viewPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view\")}\n\n					<#assign childNode = childPage.getNode() />\n\n					${viewPageURL.setParameter(\"nodeName\", childNode.getName())}\n					${viewPageURL.setParameter(\"title\", childPage.getTitle())}\n\n					<td>\n						<a href=\"${viewPageURL}\">${childPage.getTitle()}</a>\n					</td>\n					<td>\n						<a href=\"${viewPageURL}\">${dateUtil.getDate(childPage.getModifiedDate(),\"dd MMM yyyy - HH:mm:ss\", locale)} <@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(childPage.getUserId(), childPage.getUserName()))}</a>\n					</td>\n					<td>\n						<@getRatings\n							cssClass=\"child-ratings\"\n							entry=childPage\n						/>\n					</td>\n				</tr>\n			</#list>\n		</table>\n	</div>\n</#if>\n\n<@getDiscussion />\n\n<#macro getAddChildPageIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign addPageURL = renderResponse.createRenderURL() />\n\n		${addPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${addPageURL.setParameter(\"redirect\", currentURL)}\n		${addPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${addPageURL.setParameter(\"title\", \"\")}\n		${addPageURL.setParameter(\"editTitle\", \"1\")}\n		${addPageURL.setParameter(\"parentTitle\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			iconCssClass=\"icon-plus\"\n			label=true\n			message=\"add-child-page\"\n			url=addPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getAttatchmentsIcon>\n	<#assign viewPageAttachmentsURL = renderResponse.createRenderURL() />\n\n	${viewPageAttachmentsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_attachments\") }\n\n	<@liferay_ui[\"icon\"]\n		iconCssClass=\"icon-paperclip\"\n		label=true\n		message=\'${entry.getAttachmentsFileEntriesCount() + languageUtil.get(locale, \"attachments\")}\'\n		url=viewPageAttachmentsURL?string\n	/>\n</#macro>\n\n<#macro getDiscussion>\n	<#if validator.isNotNull(assetRenderer.getDiscussionPath()) && wikiPortletInstanceConfiguration.enableComments()>\n		<br />\n\n		<#assign discussionURL = renderResponse.createActionURL() />\n\n		${discussionURL.setParameter(\"javax.portlet.action\", \"/wiki/\" + assetRenderer.getDiscussionPath())}\n\n		<@liferay_ui[\"discussion\"]\n			className=wikiPageClassName\n			classPK=entry.getResourcePrimKey()\n			formAction=discussionURL?string\n			formName=\"fm2\"\n			ratingsEnabled=wikiPortletInstanceConfiguration.enableCommentRatings()\n			redirect=currentURL\n			subject=assetRenderer.getTitle(locale)\n			userId=assetRenderer.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getEditIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign editPageURL = renderResponse.createRenderURL() />\n\n		${editPageURL.setParameter(\"mvcRenderCommandName\", \"/wiki/edit_page\")}\n		${editPageURL.setParameter(\"redirect\", currentURL)}\n		${editPageURL.setParameter(\"nodeId\", entry.getNodeId()?string)}\n		${editPageURL.setParameter(\"title\", entry.getTitle())}\n\n		<@liferay_ui[\"icon\"]\n			iconCssClass=\"icon-edit\"\n			message=entry.getTitle()\n			url=editPageURL?string\n		/>\n	</#if>\n</#macro>\n\n<#macro getPageDetailsIcon>\n	<#assign viewPageDetailsURL = renderResponse.createRenderURL() />\n\n	${viewPageDetailsURL.setParameter(\"mvcRenderCommandName\", \"/wiki/view_page_details\")}\n	${viewPageDetailsURL.setParameter(\"redirect\", currentURL)}\n\n	<@liferay_ui[\"icon\"]\n		iconCssClass=\"icon-file-alt\"\n		message=\"details\"\n		url=viewPageDetailsURL?string\n	/>\n</#macro>\n\n<#macro getPrintIcon>\n	<#assign printURL = renderResponse.createRenderURL() />\n\n	${printURL.setParameter(\"viewMode\", \"print\")}\n	${printURL.setWindowState(\"pop_up\")}\n\n	<#assign\n		title = languageUtil.format(locale, \"print-x-x\", [\"hide-accessible\", htmlUtil.escape(assetRenderer.getTitle(locale))], false)\n		taglibPrintURL = \"javascript:Liferay.Util.openWindow({dialog: {width: 960}, id:\'\" + renderResponse.getNamespace() + \"printAsset\', title: \'\" + title + \"\', uri: \'\" + htmlUtil.escapeURL(printURL.toString()) + \"\'});\"\n	/>\n\n	<@liferay_ui[\"icon\"]\n		iconCssClass=\"icon-print\"\n		message=\"print\"\n		url=taglibPrintURL\n	/>\n</#macro>\n\n<#macro getRatings\n	cssClass\n	entry\n>\n	<#if wikiPortletInstanceConfiguration.enablePageRatings()>\n		<div class=\"${cssClass}\">\n			<@liferay_ui[\"ratings\"]\n				className=wikiPageClassName\n				classPK=entry.getResourcePrimKey()\n			/>\n		</div>\n	</#if>\n</#macro>\n\n<#macro getRelatedAssets>\n	<#if assetEntry?? && wikiPortletInstanceConfiguration.enableRelatedAssets()>\n		<@liferay_ui[\"asset-links\"] assetEntryId=assetEntry.getEntryId() />\n	</#if>\n</#macro>',	0,	0,	29203,	NULL,	NULL),
('6af91e74-e331-6f81-cc56-f70238fd2995',	29205,	20152,	20116,	20120,	NULL,	20120,	NULL,	'2018-05-17 14:04:28.419000',	'2018-05-17 14:04:28.419000',	20004,	0,	29201,	'ASSET-CATEGORIES-NAVIGATION-MULTI-COLUMN-LAYOUT-FTL',	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Diseo con varias columnas</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"iw_IL\">  </Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"en_US\">Multi Column Layout</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Despliega una columna para cada vocabulario. Cada columna incluye el nombre de un vocabulario con las categoras de mayor nivel del vocabulario listadas debajo.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toon een kolom voor ieder woordenboek. Iedere kolom bevat de naam van een woordenboek met de hoofd categorien eronder.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden sztr szmra. Minden oszlop tartalmazza a sztr nevt, alatta a sztr fels szint kategriival.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada vocabulrio. Cada coluna inclui o nome do vocabulrio com as categorias de nvel mais alto listadas abaixo dele.</Description><Description language-id=\"de_DE\">Stellt eine Spalte fr jedes Vokabular dar. Jede Spalte enthlt den Namen eines Vokabulars mit der obersten Kategorienebene darunter.</Description><Description language-id=\"iw_IL\">     .         ,       .</Description><Description language-id=\"fi_FI\">Nytt sarakkeen jokaiselle sanastolle. Jokainen sarake sislt sanaston nimen, miss sanaston yltason luokitukset on listattu.</Description><Description language-id=\"ca_ES\">Visualitza una columna per a cada vocabulari. Cada columna inclou el nom del vocabulari amb la categoria de nivell ms alta a sota.</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque vocabulaire. Chaque colonne inclut le nom d\'un vocabulaire avec les catgories du niveau racine listes en dessous.</Description><Description language-id=\"en_US\">Displays a column for each vocabulary. Each column includes the name of a vocabulary with the vocabulary\'s top level categories listed underneath.</Description></root>',	'display',	NULL,	'ftl',	'<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<@liferay_aui.col width=25>\n				<div class=\"results-header\">\n					<h3>\n						${entry.getUnambiguousTitle(entries, themeDisplay.getSiteGroupId(), themeDisplay.getLocale())}\n					</h3>\n				</div>\n\n				<#assign categories = entry.getCategories() />\n\n				<@displayCategories categories=categories />\n			</@liferay_aui.col>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayCategories\n	categories\n>\n	<#if categories?has_content>\n		<ul class=\"categories\">\n			<#list categories as category>\n				<li>\n					<#assign categoryURL = renderResponse.createRenderURL() />\n\n					${categoryURL.setParameter(\"resetCur\", \"true\")}\n					${categoryURL.setParameter(\"categoryId\", category.getCategoryId()?string)}\n\n					<a href=\"${categoryURL}\">${category.getName()}</a>\n\n					<#if serviceLocator??>\n						<#assign\n							assetCategoryService = serviceLocator.findService(\"com.liferay.asset.kernel.service.AssetCategoryService\")\n\n							childCategories = assetCategoryService.getChildCategories(category.getCategoryId())\n						/>\n\n						<@displayCategories categories=childCategories />\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',	0,	0,	29206,	NULL,	NULL),
