s.</Description><Description language-id=\"en_US\">Displays an icon menu with the selected languages.</Description></root>',	'display',	NULL,	'ftl',	'<#if entries?has_content>\n	<div class=\"truncate-text\">\n		<@liferay_ui[\"icon-menu\"]\n			icon=\"../aui/globe\"\n			message=locale.getDisplayName(locale)\n		>\n			<#list entries as entry>\n				<#if !entry.isSelected() && !entry.isDisabled()>\n					<@liferay_ui[\"icon\"]\n						image=\"../language/\" + entry.getLanguageId()\n						label=true\n						lang=entry.getW3cLanguageId()\n						message=entry.getLongDisplayName()\n						url=entry.getURL()\n					/>\n				</#if>\n			</#list>\n		</@>\n	</div>\n</#if>',	0,	0,	29273,	NULL,	NULL),
('a4216da5-c42c-edaf-e528-7bc3949ae468',	29275,	20152,	20116,	20120,	NULL,	20120,	NULL,	'2018-05-17 14:04:29.771000',	'2018-05-17 14:04:29.771000',	29268,	0,	29201,	'LANGUAGE-LONG-TEXT-FTL',	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Texto largo</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Lange tekst</Name><Name language-id=\"hu_HU\">Hossz szveg</Name><Name language-id=\"pt_BR\">Texto Longo</Name><Name language-id=\"de_DE\">Langer Text</Name><Name language-id=\"iw_IL\"> </Name><Name language-id=\"fi_FI\">Pitkteksti</Name><Name language-id=\"ca_ES\">Text llarg</Name><Name language-id=\"fr_FR\">Texte long</Name><Name language-id=\"en_US\">Long Text</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra el nombre completo de cada idioma (ej.: Espaol)</Description><Description language-id=\"ja_JP\">:)</Description><Description language-id=\"nl_NL\">Toon de volledige naam van iedere taal (bv Spaans).</Description><Description language-id=\"hu_HU\">Megjelenti a teljes nevet az egyes nyelvekhez (pl.: spanyol).</Description><Description language-id=\"pt_BR\">Exibe o nome completo de cada idioma (ex.: Espanhol).</Description><Description language-id=\"de_DE\">Zeigt den vollstndigen Namen jeder Sprache (z.B. Spanisch).</Description><Description language-id=\"iw_IL\">       ( ).</Description><Description language-id=\"fi_FI\">Nytt kokonimen joka kielell (esim. suomeksi).</Description><Description language-id=\"ca_ES\">Mostra el nom complet de cada idioma (per exemple, Catal).</Description><Description language-id=\"fr_FR\">Affiche le nom complet de chaque langue (par exemple: Espagnol).</Description><Description language-id=\"en_US\">Displays the full name of each language (e.g. Spanish).</Description></root>',	'display',	NULL,	'ftl',	'<style>\n	.language-entry-long-text {\n		display: inline-block;\n		padding: 0 0.5em;\n	}\n</style>\n\n<#if entries?has_content>\n	<#list entries as entry>\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"a\"]\n				cssClass=\"language-entry-long-text\"\n				href=entry.getURL()\n				label=entry.getLongDisplayName()\n				lang=entry.getW3cLanguageId()\n			/>\n		</#if>\n	</#list>\n</#if>',	0,	0,	29276,	NULL,	NULL),
('fe3d3e2c-46cf-84bb-7b20-331d1b6d8f19',	29278,	20152,	20116,	20120,	NULL,	20120,	NULL,	'2018-05-17 14:04:29.808000',	'2018-05-17 14:04:29.808000',	29268,	0,	29201,	'LANGUAGE-SELECT-BOX-FTL',	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Caja de seleccin</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Keuze veld</Name><Name language-id=\"hu_HU\">Vlaszt doboz</Name><Name language-id=\"pt_BR\">Caixa de Seleo</Name><Name language-id=\"de_DE\">Auswahlliste</Name><Name language-id=\"iw_IL\"> </Name><Name language-id=\"fi_FI\">Valintalaatikko</Name><Name language-id=\"ca_ES\">Caixa de selecci</Name><Name language-id=\"fr_FR\">Slectionner boite</Name><Name language-id=\"en_US\">Select Box</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra una caja de seleccin con los idiomas seleccionados.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toen keuze veld met de geselecteerde talen.</Description><Description language-id=\"hu_HU\">Megjelenti az ikon ment a vlasztott nyelveken.</Description><Description language-id=\"pt_BR\">Exibe uma caixa de seleo com os idiomas selecionados.</Description><Description language-id=\"de_DE\">Zeigt eine Auswahllist mit den ausgewhlten Sprachen an</Description><Description language-id=\"iw_IL\">     .</Description><Description language-id=\"fi_FI\">Nytt valintalaatikon valituilla kielill.</Description><Description language-id=\"ca_ES\">Mostra un quadre de selecci amb els idiomes seleccionats</Description><Description language-id=\"fr_FR\">Affiche une boite slectionne avec les langues slectionnes.</Description><Description language-id=\"en_US\">Displays a select box with the selected languages</Description></root>',	'display',	NULL,	'ftl',	'<#if entries?has_content>\n	<#assign languageId = localeUtil.toLanguageId(locale) />\n\n	<style>\n		.taglib-language-option {\n			background: none no-repeat 5px center;\n			padding-left: 25px;\n		}\n\n		<#list entries as entry>\n			.taglib-language-option-${entry.getW3cLanguageId()} {\n				background-image: url(${themeDisplay.getPathThemeImages()}/language/${entry.getLanguageId()}.png);\n			}\n		</#list>\n	</style>\n\n	<@liferay_aui[\"form\"]\n		action=formAction\n		method=\"post\"\n		name=\'${namespace + formName}\'\n		useNamespace=false\n	>\n		<@liferay_aui[\"select\"]\n			changesContext=true\n			id=\'${namespace + formName}\'\n			label=\"\"\n			name=\'${name}\'\n			onChange=\'${namespace + \"changeLanguage();\"}\'\n			title=\"language\"\n		>\n			<#list entries as entry>\n				<@liferay_aui[\"option\"]\n					cssClass=\"taglib-language-option taglib-language-option-${entry.getW3cLanguageId()}\"\n					disabled=entry.isDisabled()\n					label=entry.getLongDisplayName()\n					lang=entry.getW3cLanguageId()\n					selected=entry.isSelected()\n					value=entry.getLanguageId()\n				/>\n			</#list>\n		</@>\n	</@>\n\n	<@liferay_aui[\"script\"]>\n		function ${namespace}changeLanguage() {\n			var languageId = AUI.$(document.${namespace + formName}.${name}).val();\n\n			submitForm(document.${namespace + formName});\n		}\n	</@>\n</#if>',	0,	0,	29279,	NULL,	NULL),
