(29237,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:28.925000',	20162,	0,	29235,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Navigation common macros</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Navigation common macros</Name><Name language-id=\"hu_HU\">Navigation common macros</Name><Name language-id=\"pt_BR\">Macro do Menu de Navegao</Name><Name language-id=\"de_DE\">Navigation, gelufige Makros</Name><Name language-id=\"iw_IL\">Navigation common macros</Name><Name language-id=\"fi_FI\">Navigation common macros</Name><Name language-id=\"ca_ES\">Macros de navegaci comuns</Name><Name language-id=\"fr_FR\">Macro de menu de navigation</Name><Name language-id=\"en_US\">Navigation common macros</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Contiene macros comunes para las plantillas de mens de navegacin.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Bevat veelvoorkomende macro\'s voor navigatiemenu-sjablonen.</Description><Description language-id=\"hu_HU\">ltalnos makrkat tartalmaz a navigcis men sablonokhoz.</Description><Description language-id=\"pt_BR\">Contm macros comuns para modelos de menus de navegao.</Description><Description language-id=\"de_DE\">Enthlt gelufig Makros fr Navigationsmen-Vorlagen.</Description><Description language-id=\"iw_IL\">       </Description><Description language-id=\"fi_FI\">Sislt yleisi makroja navigaatiovalikon esitysmalleihin.</Description><Description language-id=\"ca_ES\">Cont macros comuns per a les plantilles de men de navegaci.</Description><Description language-id=\"fr_FR\">Contient les macros communs pour les gabarits de menu de navigation.</Description><Description language-id=\"en_US\">Contains common macros for navigation menu templates.</Description></root>',	'ftl',	'<#macro buildNavigation\n	branchNavItems\n	cssClass\n	displayDepth\n	includeAllChildNavItems\n	navItemLevel\n	navItems\n>\n	<#if navItems?has_content && ((displayDepth == 0) || (navItemLevel <= displayDepth))>\n		<ul class=\"${cssClass} level-${navItemLevel}\">\n			<#list navItems as navItem>\n				<#assign\n					nav_item_attr_selected = \"\"\n					nav_item_css_class = \"lfr-nav-item\"\n				/>\n\n				<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n					<#assign nav_item_css_class = \"${nav_item_css_class} open\" />\n				</#if>\n\n				<#if navItem.isSelected()>\n					<#assign\n						nav_item_attr_selected = \"aria-selected=\'true\'\"\n						nav_item_css_class = \"${nav_item_css_class} selected active\"\n					/>\n				</#if>\n\n				<li class=\"${nav_item_css_class}\" ${nav_item_attr_selected}>\n					<#if navItem.isBrowsable()>\n						<a class=\"${nav_item_css_class}\" href=\"${navItem.getRegularURL()!\"\"}\" ${navItem.getTarget()}>${navItem.getName()}</a>\n					<#else>\n						${navItem.getName()}\n					</#if>\n\n					<#if includeAllChildNavItems || navItem.isInNavigation(branchNavItems)>\n						<@buildNavigation\n							branchNavItems=branchNavItems\n							cssClass=cssClass\n							displayDepth=displayDepth\n							includeAllChildNavItems=includeAllChildNavItems\n							navItemLevel=(navItemLevel + 1)\n							navItems=navItem.getChildren()\n						/>\n					</#if>\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',	0,	20120,	NULL,	'2018-05-17 14:04:28.925000'),
(29240,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:28.979000',	20162,	0,	29238,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Botn de divisin de mens desplegables</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Split Button Dropdowns</Name><Name language-id=\"hu_HU\">Oszt gomb legrdlk</Name><Name language-id=\"pt_BR\">Botes Suspensos Separados</Name><Name language-id=\"de_DE\">Split-Button-Dropdowns</Name><Name language-id=\"iw_IL\">    </Name><Name language-id=\"fi_FI\">Jaettu pudotuslistanappi</Name><Name language-id=\"ca_ES\">Mens desplegables amb bot de divisi</Name><Name language-id=\"fr_FR\">Bouton sparer de listes droulantes</Name><Name language-id=\"en_US\">Split Button Dropdowns</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">Bootstrap</Description><Description language-id=\"es_ES\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"hu_HU\">Megjelent egy legrdl navigcis ment Bootstrap gombokkal.</Description><Description language-id=\"pt_BR\">Exibir um menu de navegao dropdown com botes do Bootstrap.</Description><Description language-id=\"de_DE\">Zeigt ein Dropdown-Navigationsmen, wobei die Wurzelelemente als Schaltflchen dargestellt werden.</Description><Description language-id=\"iw_IL\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"fi_FI\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"ca_ES\">Mostra un men de navegaci desplegable amb els elements del men arrel que es mostren com a botons.</Description><Description language-id=\"fr_FR\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description><Description language-id=\"en_US\">Displays a dropdown navigation menu with root menu items shown as buttons.</Description></root>',	'ftl',	'<#if !entries?has_content>\n	<#if preview>\n		<div class=\"alert alert-info\">\n			<@liferay.language key=\"there-are-no-pages-to-display-for-the-current-page-level\" />\n		</div>\n	</#if>\n<#else>\n	<#assign\n		portletDisplay = themeDisplay.getPortletDisplay()\n\n		navbarId = \"navbar_\" + portletDisplay.getId()\n	/>\n\n	<div id=\"${navbarId}\">\n		<ul class=\"navbar-site split-button-dropdowns\">\n			<#assign navItems = entries />\n\n			<#list navItems as navItem>\n				<#assign showChildren = (displayDepth != 1) && navItem.hasBrowsableChildren() />\n\n				<#if navItem.isBrowsable() || showChildren>\n					<#assign\n						nav_item_caret = \"\"\n						nav_item_css_class = \"\"\n						nav_item_href_link = \"\"\n					/>\n\n					<#if navItem.isSelected()>\n						<#assign nav_item_css_class = \"active\" />\n					</#if>\n\n					<#if showChildren>\n						<#assign toggle_text>\n							<@liferay.language key=\"toggle\" />\n						</#assign>\n\n						<#assign nav_item_caret = \"<button aria-expanded=\'false\' aria-haspopup=\'true\' class=\'${nav_item_css_class} btn btn-default dropdown-toggle\' data-toggle=\'dropdown\' type=\'button\'><span class=\'caret\'></span><span class=\'sr-only\'>${toggle_text}</span></button>\" />\n					</#if>\n\n					<#if navItem.isBrowsable()>\n						<#assign nav_item_href_link = \"href=\'${navItem.getURL()}\' ${navItem.getTarget()}\" />\n					</#if>\n\n					<li>\n						<a aria-labelledby=\"layout_${navItem.getLayoutId()}\" class=\"${nav_item_css_class} btn btn-default\" ${nav_item_href_link}><span>${navItem.getName()}</span></a>${nav_item_caret}\n\n						<#if showChildren>\n							<ul class=\"child-menu dropdown-menu\" role=\"menu\">\n								<#list navItem.getBrowsableChildren() as childNavigationItem>\n									<#assign\n										nav_child_attr_selected = \"\"\n										nav_child_css_class = \"\"\n									/>\n\n									<#if childNavigationItem.isSelected()>\n										<#assign\n											nav_child_attr_selected = \"aria-selected=\'true\'\"\n											nav_child_css_class = \"active\"\n										/>\n									</#if>\n\n									<li class=\"${nav_child_css_class}\" id=\"layout_${childNavigationItem.getLayoutId()}\" ${nav_child_attr_selected} role=\"presentation\">\n										<a aria-labelledby=\"layout_${childNavigationItem.getLayoutId()}\" href=\"${childNavigationItem.getURL()}\" ${childNavigationItem.getTarget()} role=\"menuitem\">${childNavigationItem.getName()}</a>\n									</li>\n								</#list>\n							</ul>\n						</#if>\n					</li>\n				</#if>\n			</#list>\n		</ul>\n	</div>\n\n	<@liferay_aui.script use=\"liferay-navigation-interaction\">\n		var navigation = A.one(\'#${navbarId}\');\n\n		Liferay.Data.NAV_INTERACTION_LIST_SELECTOR = \'.navbar-site\';\n		Liferay.Data.NAV_LIST_SELECTOR = \'.navbar-site\';\n\n		if (navigation) {\n			navigation.plug(Liferay.NavigationInteraction);\n		}\n	</@>\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:28.979000'),
(29243,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.105000',	20008,	0,	29241,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Color por popularidad</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Kleur op populariteit</Name><Name language-id=\"hu_HU\">Szn npszersg alapjn</Name><Name language-id=\"pt_BR\">Colorir por Popularidade</Name><Name language-id=\"de_DE\">Nach Popularitt frben</Name><Name language-id=\"iw_IL\">  </Name><Name language-id=\"fi_FI\">Vri suosion mukaan</Name><Name language-id=\"ca_ES\">Color per popularitat</Name><Name language-id=\"fr_FR\">Couleur par popularit</Name><Name language-id=\"en_US\">Color by Popularity</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">  (),  (),  ().</Description><Description language-id=\"es_ES\">Muestra las etiquetas de contenido coloreadas segn su popularidad : rojo (alta), amarilla (media) y verde (baja).</Description><Description language-id=\"ja_JP\">:())</Description><Description language-id=\"nl_NL\">Toon content labels volgens populariteit: rood (hoog), geel (midden) en groen (laag).</Description><Description language-id=\"hu_HU\">Megjelenti a tartalom cmkket npszersg szerint sznezve: vrs (magas), srga (kzepes), s zld (alacsony).</Description><Description language-id=\"pt_BR\">Exibe as tags coloridas por popularidade: vermelho (alta), amarelo (mdia) e verde (baixa).</Description><Description language-id=\"de_DE\">Schlagwrter nach Popularitt frben: Rot (hoch), gelb (mittel), grn (niedrig).</Description><Description language-id=\"iw_IL\">        :  (),  ()  ().</Description><Description language-id=\"fi_FI\">Nytt sislttageja, mitk on vritetty suosion mukaan: punainen (korkea), keltainen (keskiverto) ja virhe (alhainen)</Description><Description language-id=\"ca_ES\">Mostra les etiquetes per colors segons popularitat: vermell (alta), groga (mitjana) i verda (baixa).</Description><Description language-id=\"fr_FR\">Affiche les tiquettes d\'asset colories par popularit: rouge (lev), jaune (moyen), et vert (bas).</Description><Description language-id=\"en_US\">Displays asset tags colored by popularity: red (high), yellow (medium), and green (low).</Description></root>',	'ftl',	'<#if entries?has_content>\n	<ul class=\"tag-items tag-list\">\n		<#assign\n			scopeGroupId = getterUtil.getLong(scopeGroupId, themeDisplay.getScopeGroupId())\n			classNameId = getterUtil.getLong(classNameId, 0)\n\n			maxCount = 1\n			minCount = 1\n		/>\n\n		<#list entries as entry>\n			<#assign\n				maxCount = liferay.max(maxCount, entry.getAssetCount())\n				minCount = liferay.min(minCount, entry.getAssetCount())\n			/>\n		</#list>\n\n		<#assign multiplier = 1 />\n\n		<#if maxCount != minCount>\n			<#assign multiplier = 3 / (maxCount - minCount) />\n		</#if>\n\n		<#list entries as entry>\n			<li class=\"taglib-asset-tags-summary\">\n				<#assign popularity = (maxCount - (maxCount - (entry.getAssetCount() - minCount))) * multiplier />\n\n				<#if popularity < 1>\n					<#assign color = \"green\" />\n				<#elseif (popularity >= 1) && (popularity < 2)>\n					<#assign color = \"orange\" />\n				<#else>\n					<#assign color = \"red\" />\n				</#if>\n\n				<#assign tagURL = renderResponse.createRenderURL() />\n\n				${tagURL.setParameter(\"resetCur\", \"true\")}\n				${tagURL.setParameter(\"tag\", entry.getName())}\n\n				<a class =\"tag\" style=\"color: ${color};\" href=\"${tagURL}\">\n					${entry.getName()}\n\n					<#if entry.getAssetCount()?? && getterUtil.getBoolean(showAssetCount)>\n						<span class=\"tag-asset-count\">(${entry.getAssetCount()})</span>\n					</#if>\n				</a>\n			</li>\n		</#list>\n	</ul>\n\n	<br style=\"clear: both;\" />\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:29.105000'),
(29247,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.197000',	29244,	0,	29245,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Navegacin</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Navigatie</Name><Name language-id=\"hu_HU\">Navigci</Name><Name language-id=\"pt_BR\">Navegao</Name><Name language-id=\"de_DE\">Navigation</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Navigointi</Name><Name language-id=\"ca_ES\">Navegaci</Name><Name language-id=\"fr_FR\">Navigation</Name><Name language-id=\"en_US\">Navigation</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">RSSFeed</Description><Description language-id=\"es_ES\">Muestra los feeds RSS como una barra de navegacin del panel izquierdo. Al hacer clic en un feed se muestra una lista de entradas de feed en el panel derecho.</Description><Description language-id=\"ja_JP\">RSS</Description><Description language-id=\"nl_NL\">Geeft de RSS-feeds als een navigatiebalk in het linkerpaneel weer. Als u op een feed klikt wordt een lijst van van feed-entries in het rechterpaneel getoond.</Description><Description language-id=\"hu_HU\">Megjelenti az RSS hrcsatornkat navigcis oszlopknt a bal oldalon. Egy hrcsatornra kattintva megjelenti a hrcsatorna bejegyzsek listjt a jobb oldalon.</Description><Description language-id=\"pt_BR\">Exibe os feeds RSS como uma barra de navegao no painel esquerdo. Clicar em um feed exibe uma lista de entradas de feed no painel direito.</Description><Description language-id=\"de_DE\">Stellt die RSS-Feeds als Navigationsleiste im linken Bereich dar. Nach Anklicken eines Feeds werden die entsprechenden Feedeintrge im rechten Bereich dargestellt.</Description><Description language-id=\"iw_IL\">   -RSS    .          .</Description><Description language-id=\"fi_FI\">Nytt RSS-sytteet navigaatiopalkissa vasemmassa paneelissa. Klikkaamalla sytett nytetn sytteen arvot oikeassa paneelissa.</Description><Description language-id=\"ca_ES\">Mostra els canals RSS com una barra de navegaci en el tauler esquerra. Al fer un clic en un canal es mostraran la llista d\'entrades en el tauler dret.</Description><Description language-id=\"fr_FR\">Affiche les flux RSS en tant que barre de navigation dans le panneau gauche. Cliquer sur un flux affiche une liste d\'entres de flux sur le panneau droit.</Description><Description language-id=\"en_US\">Displays the RSS feeds as a navigation bar on the left panel. Clicking on a feed displays a list of feed entries on the right panel.</Description></root>',	'ftl',	'<#assign rssPortletInstanceConfiguration = rssDisplayContext.getRSSPortletInstanceConfiguration() />\n\n<style>\n	.portlet-rss .feed-entry-content {\n		margin-bottom: 20px;\n		padding-left: 0;\n	}\n</style>\n\n<#if entries?has_content>\n	<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n	<div class=\"container-fluid\">\n		<div class=\"row\" id=\"<@portlet.namespace />feedsTab\">\n			<ul class=\"col-xs-4\">\n				<#list entries as curEntry>\n					<li><a href=\"#tab-${curEntry_index}\">${htmlUtil.escape(curEntry.getTitle())}</a></li>\n				</#list>\n			</ul>\n\n			<div class=\"col-xs-8 tab-content\">\n				<#list entries as curEntry>\n					<#assign rssFeedEntries = curEntry.getRSSFeedEntries(themeDisplay) />\n\n					<#if rssFeedEntries??>\n						<div id=\"tab-${curEntry_index}\" class=\"tab-pane\">\n							<#list rssFeedEntries as rssFeedEntry>\n								<#if (rssFeedEntry_index > entriesPerFeed?number)>\n									<#break>\n								</#if>\n\n								<#assign syndEntry = rssFeedEntry.getSyndEntry() />\n\n								<div class=\"feed-entry-content\">\n									<div class=\"feed-title\">\n										<@liferay_aui[\"a\"] href=\"${htmlUtil.escapeJSLink(rssFeedEntry.getSyndEntryLink())}\">${htmlUtil.escape(syndEntry.getTitle())}</@>\n									</div>\n\n									<#if rssPortletInstanceConfiguration.showFeedTitle() && syndEntry.getAuthor()??>\n										<div class=\"feed-entry-author\">\n											${htmlUtil.escape(syndEntry.getAuthor())}\n										</div>\n									</#if>\n\n									<#if syndEntry.getPublishedDate()??>\n										<div class=\"feed-date\">\n											<@liferay_ui[\"icon\"]\n												iconCssClass=\"icon-calendar\"\n												label=true\n												message=\"${dateUtil.getDate(syndEntry.getPublishedDate(), dateFormat, locale)}\"\n											/>\n										</div>\n									</#if>\n\n									${rssFeedEntry.getSanitizedContent()}\n								</div>\n							</#list>\n						</div>\n					</#if>\n				</#list>\n			</div>\n		</div>\n	</div>\n\n	<@liferay_aui[\"script\"] use=\"aui-base,aui-tabview\">\n		new A.TabView(\n			{\n				srcNode: \'#<@portlet.namespace />feedsTab\',\n				stacked: true,\n				type: \'pills\'\n			}\n		).render();\n	</@>\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:29.197000'),
(29250,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.258000',	20052,	0,	29248,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Diseo con varias columnas</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Lay-out met meerdere kolommen</Name><Name language-id=\"hu_HU\">Tbb oszlopos elrendezs</Name><Name language-id=\"pt_BR\">Layout em Mltiplas Colunas</Name><Name language-id=\"de_DE\">Multi-Spalten-Layout</Name><Name language-id=\"iw_IL\">  </Name><Name language-id=\"fi_FI\">Usean sarakkeen asettelu</Name><Name language-id=\"ca_ES\">Plana multi-columna</Name><Name language-id=\"fr_FR\">Mise en page multi-colonne</Name><Name language-id=\"en_US\">Multi Column Layout</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra una columna por cada pgina primaria. Cada columna contiene el nombre de una pgina primaria con las subordinadas inmediatas de esta pgina listadas debajo de ella.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toon een kolom voor elke top level pagina. Elke kolom bevat de naam van een top level pagina met de directe onderliggende pagina\'s eronder.</Description><Description language-id=\"hu_HU\">Megjelent egy oszlopot minden fels szint oldal szmra. Minden oszlop tartalmazza a fels szint oldal nevt, alatta a fels szint oldal gyerekvel.</Description><Description language-id=\"pt_BR\">Exibe uma coluna para cada pgina primria. Cada coluna contm o nome de uma pgina primria com as subordinadas imediatas desta pgina listadas abaixo dela.</Description><Description language-id=\"de_DE\">Zeigt eine Spalte fr jede Seite der obersten Ebene an. Jede Spalte enthlt den Namen der Seite der obersten Ebene sowie die Seiten der direkt untergeordneten Ebene.</Description><Description language-id=\"iw_IL\">      .            .</Description><Description language-id=\"fi_FI\">Nytt sarakkeen jokaisella yltason sivulla. Jokainen sarake sislt nimen ja yltason sivun, miss alisivut on listattu alla.</Description><Description language-id=\"ca_ES\">Mostra una columna per a cada pgina de nivell superior. Cada columna inclou el nom d\'una pgina de nivell superior amb pgines fill immediates indicades a sota.</Description><Description language-id=\"fr_FR\">Affiche une colonne pour chaque page du niveau racine. Chaque colonne inclut le nom d\'une page du niveau racine avec ses pages enfants listes en dessous.</Description><Description language-id=\"en_US\">Displays a column for each top level page. Each column includes the name of a top level page with the page\'s immediate children listed underneath.</Description></root>',	'ftl',	'<#if entries?has_content>\n	<@liferay_aui.row>\n		<#list entries as entry>\n			<@liferay_aui.col width=25>\n				<div class=\"results-header\">\n					<h3>\n						<a\n\n						<#assign layoutType = entry.getLayoutType() />\n\n						<#if layoutType.isBrowsable()>\n							href=\"${portalUtil.getLayoutURL(entry, themeDisplay)}\"\n						</#if>\n\n						>${entry.getName(locale)}</a>\n					</h3>\n				</div>\n\n				<@displayPages pages=entry.getChildren() />\n			</@liferay_aui.col>\n		</#list>\n	</@liferay_aui.row>\n</#if>\n\n<#macro displayPages\n	pages\n>\n	<#if pages?has_content>\n		<ul class=\"child-pages\">\n			<#list pages as page>\n				<li>\n					<a\n\n					<#assign pageType = page.getLayoutType() />\n\n					<#if pageType.isBrowsable()>\n						href=\"${portalUtil.getLayoutURL(page, themeDisplay)}\"\n					</#if>\n\n					>${page.getName(locale)}</a>\n\n					<@displayPages pages=page.getChildren() />\n				</li>\n			</#list>\n		</ul>\n	</#if>\n</#macro>',	0,	20120,	NULL,	'2018-05-17 14:04:29.258000'),
(29253,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.305000',	20011,	0,	29251,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Bsico</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Basis</Name><Name language-id=\"hu_HU\">Egyszer</Name><Name language-id=\"pt_BR\">Bsico</Name><Name language-id=\"de_DE\">Einfach</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Perus</Name><Name language-id=\"ca_ES\">Bsic</Name><Name language-id=\"fr_FR\">Basique</Name><Name language-id=\"en_US\">Basic</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra de forma compacta ttulos, autores y resmenes para las entradas del blog.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Geeft titels, auteurs en samenvatting compact weer voor blogs.</Description><Description language-id=\"hu_HU\">Megjelenti kompakt mdon a cmeket, szerzket s kivonatokat a blog bejegyzsekhez.</Description><Description language-id=\"pt_BR\">Exibe ttulos, autores e resumos compactamente para posts de blog.</Description><Description language-id=\"de_DE\">Kompakte Darstellung von Titel, Autoren und Kurzfassungen fr Blogeintrge.</Description><Description language-id=\"iw_IL\"> ,       .</Description><Description language-id=\"fi_FI\">Nytt blogien otsikot, tekijt ja lyhenteet lyhyesti</Description><Description language-id=\"ca_ES\">Mostra els titles, autors i resums de forma compacta per les entrades del blog.</Description><Description language-id=\"fr_FR\">Affiche titres, auteurs, et abstraits de manire compacte pour les entres de blog.</Description><Description language-id=\"en_US\">Displays titles, authors, and abstracts compactly for blog entries.</Description></root>',	'ftl',	'<#list entries as entry>\n	<div class=\"entry\">\n		<#assign viewURL = renderResponse.createRenderURL() />\n\n		${viewURL.setParameter(\"mvcRenderCommandName\", \"/blogs/view_entry\")}\n		${viewURL.setParameter(\"redirect\", currentURL)}\n		${viewURL.setParameter(\"urlTitle\", entry.getUrlTitle())}\n\n		<div class=\"entry-content\">\n			<div class=\"entry-title\">\n				<h2><a href=\"${viewURL}\">${htmlUtil.escape(entry.getTitle())}</a></h2>\n			</div>\n		</div>\n\n		<div class=\"entry-body\">\n			<div class=\"entry-author icon-user\">\n				<@liferay.language key=\"written-by\" /> ${htmlUtil.escape(portalUtil.getUserName(entry.getUserId(), entry.getUserName()))}\n			</div>\n\n			<#assign summary = entry.getDescription() />\n\n			<#if validator.isNull(summary)>\n				<#assign summary = entry.getContent() />\n			</#if>\n\n			${stringUtil.shorten(htmlUtil.stripHtml(summary), 100)}\n\n			<a href=\"${viewURL}\"><@liferay.language key=\"read-more\" /> <span class=\"hide-accessible\"><@liferay.language key=\"about\"/>${htmlUtil.escape(entry.getTitle())}</span> &raquo;</a>\n		</div>\n\n		<div class=\"entry-footer\">\n			<span class=\"entry-date icon-date\">\n				${dateUtil.getDate(entry.getCreateDate(), \"dd MMM yyyy - HH:mm:ss\", locale)}\n			</span>\n\n			<#assign blogsEntryClassName = \"com.liferay.blogs.kernel.model.BlogsEntry\" />\n\n			<#if blogsPortletInstanceConfiguration.enableFlags()>\n				<@liferay_flags[\"flags\"]\n					className=blogsEntryClassName\n					classPK=entry.getEntryId()\n					contentTitle=entry.getTitle()\n					reportedUserId=entry.getUserId()\n				/>\n			</#if>\n\n			<span class=\"entry-categories\">\n				<@liferay_ui[\"asset-categories-summary\"]\n					className=blogsEntryClassName\n					classPK=entry.getEntryId()\n					portletURL=renderResponse.createRenderURL()\n				/>\n			</span>\n			<span class=\"entry-tags\">\n				<@liferay_ui[\"asset-tags-summary\"]\n					className=blogsEntryClassName\n					classPK=entry.getEntryId()\n					portletURL=renderResponse.createRenderURL()\n				/>\n			</span>\n		</div>\n	</div>\n\n	<div class=\"separator\"><!-- --></div>\n</#list>',	0,	20120,	NULL,	'2018-05-17 14:04:29.305000'),
(29257,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.383000',	29254,	0,	29255,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Flechas</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Pijltjes</Name><Name language-id=\"hu_HU\">Nyilak</Name><Name language-id=\"pt_BR\">Setas</Name><Name language-id=\"de_DE\">Pfeile</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Nuolet</Name><Name language-id=\"ca_ES\">Fletxes</Name><Name language-id=\"fr_FR\">Flches</Name><Name language-id=\"en_US\">Arrows</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra el camino de navegacin en la que todo elemento de navegacin es representado por una flecha con su ttulo y enlace.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toont een klikpad waarin elke navigatie-element wordt weergegeven door een pijltje met de titel en de link.</Description><Description language-id=\"hu_HU\">Egy tvonalat jelent meg, amelyben minden navigcis elemet egy nyl kpvisel a cmkjvel s a linkkel egytt.</Description><Description language-id=\"pt_BR\">Exibe o caminho de navegao no qual todo elemento de navegao  representado por uma seta com seu ttulo e link.</Description><Description language-id=\"de_DE\">Stellt eine Breadcrumbnavigation dar, in der jedes Navigationselement als Pfeil mit Titel und Link angezeigt wird.</Description><Description language-id=\"iw_IL\">              .</Description><Description language-id=\"fi_FI\">Nytt murupolun, miss jokainen navigaatio elementti nytetn nuolella otsikon kanssa ja linkill.</Description><Description language-id=\"ca_ES\">Mostra una ruta de navegaci en qu cada element de navegaci est representat per una fletxa amb el seu ttol i enlla.</Description><Description language-id=\"fr_FR\">Affiche un fil d\'ariane dans lequel chaque lment de navigation est reprsent par une flche avec son titre et lien.</Description><Description language-id=\"en_US\">Displays a breadcrumb in which every navigation element is represented by an arrow with its title and link.</Description></root>',	'ftl',	'<#if entries?has_content>\n	<@liferay_util[\"html-top\"]>\n		<style>\n			.breadcrumb-arrows li {\n				background-color: #EFEFEF;\n				margin-bottom: 3px;\n				overflow: visible;\n			}\n\n			.breadcrumb-arrows li + li::before {\n				content: none;\n			}\n\n			.breadcrumb-arrows li > a {\n				border-right: 4px solid #FFF;\n				display: block;\n				max-width: 100%;\n				position: relative;\n			}\n\n			.breadcrumb-arrows .entry {\n				line-height: 40px;\n				overflow: hidden;\n				padding-left: 30px;\n				padding-right: 7px;\n				text-overflow: ellipsis;\n				white-space: nowrap;\n			}\n\n			.breadcrumb-arrows a::after {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #EFEFEF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				position: absolute;\n				right: -20px;\n				top: 0;\n				width: 0;\n				z-index: 2;\n			}\n\n			.breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child {\n				border-bottom-right-radius: 4px;\n				border-right-width: 0;\n				border-top-right-radius: 4px;\n				position: relative;\n			}\n\n			.breadcrumb-arrows li:last-child::before {\n				border-bottom: 20px inset transparent;\n				border-left: 20px solid #FFF;\n				border-top: 20px inset transparent;\n				content: \'\';\n				height: 0;\n				left: 0;\n				position: absolute;\n				top: 0;\n				width: 0;\n			}\n\n			.breadcrumb-arrows li:last-child .entry {\n				padding-right: 23px;\n			}\n\n			.breadcrumb-arrows li:first-child {\n				border-bottom-left-radius: 4px;\n				border-top-left-radius: 4px;\n			}\n\n			.breadcrumb-arrows li:first-child::before {\n				border-left-width: 0;\n			}\n\n			.breadcrumb-arrows li:first-child .entry {\n				padding-left: 23px;\n			}\n\n			.breadcrumb-arrows .active {\n				background-color: #007ACC;\n			}\n\n			.breadcrumb-arrows .active a, .breadcrumb-arrows .active .entry {\n				color: #FFF;\n			}\n\n			.breadcrumb-arrows .active a::after {\n				border-left-color: #007ACC;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li > a, .portlet-borderless .breadcrumb-arrows li > a, .taglib-portlet-preview .breadcrumb-arrows li > a {\n				border-right-color: #F5F7F8;\n			}\n\n			.portlet-barebone .breadcrumb-arrows li:last-child::before, .portlet-barebone .breadcrumb-arrows li:nth-child(n+2) a::before, .portlet-borderless .breadcrumb-arrows li:last-child::before, .portlet-borderless .breadcrumb-arrows li:nth-child(n+2) a::before, .taglib-portlet-preview .breadcrumb-arrows li:last-child::before, .taglib-portlet-preview .breadcrumb-arrows li:nth-child(n+2) a::before {\n				border-left-color: #F5F7F8;\n			}\n		</style>\n	</@>\n\n	<div class=\"breadcrumb breadcrumb-arrows\">\n		<#assign cssClass = \"\" />\n\n		<#list entries as entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\">\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				<div class=\"entry\">\n					${htmlUtil.escape(entry.getTitle())}\n				</div>\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</div>\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:29.383000'),
