 entry>\n			<#if entry?is_last>\n				<#assign cssClass = \"active\" />\n			</#if>\n\n			<li class=\"${cssClass}\">\n				<#if entry?has_next>\n					<a\n\n					<#if entry.isBrowsable()>\n						href=\"${entry.getURL()!\"\"}\"\n					</#if>\n\n					>\n				</#if>\n\n				${htmlUtil.escape(entry.getTitle())}\n\n				<#if entry?has_next>\n					</a>\n				</#if>\n			</li>\n		</#list>\n	</ul>\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:29.466000'),
(29267,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.558000',	29264,	0,	29265,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\">Carousel</Name><Name language-id=\"es_ES\">Carrusel</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Carrousel</Name><Name language-id=\"hu_HU\">Krhinta</Name><Name language-id=\"pt_BR\">Carrossel</Name><Name language-id=\"de_DE\">Karussel</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Karuselli</Name><Name language-id=\"ca_ES\">Carrussel</Name><Name language-id=\"fr_FR\">Carrousel</Name><Name language-id=\"en_US\">Carousel</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra imgenes en un carrusel.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Geeft afbeeldingen weer in een carrousel.</Description><Description language-id=\"hu_HU\">Megjelenti a kpeket krhintaszeren.</Description><Description language-id=\"pt_BR\">Exibe imagens num carrossel.</Description><Description language-id=\"de_DE\">Darstellung von Bildern in einem Karussell.</Description><Description language-id=\"iw_IL\">   .</Description><Description language-id=\"fi_FI\">Nytt kuvat karusellissa.</Description><Description language-id=\"ca_ES\">Mostra imatges en format carrusel.</Description><Description language-id=\"fr_FR\">Affiche les images dans un carrousel.</Description><Description language-id=\"en_US\">Displays images in a carousel.</Description></root>',	'ftl',	'<#if entries?has_content>\n	<style>\n		#<@portlet.namespace />carousel .carousel-item {\n			background-color: #000;\n			height: 250px;\n			overflow: hidden;\n			text-align: center;\n			width: 700px;\n		}\n\n		#<@portlet.namespace />carousel .carousel-item img {\n			max-height: 250px;\n			max-width: 700px;\n		}\n	</style>\n\n	<div id=\"<@portlet.namespace />carousel\">\n		<#assign imageMimeTypes = propsUtil.getArray(\"dl.file.entry.preview.image.mime.types\") />\n\n		<#list entries as entry>\n			<#if imageMimeTypes?seq_contains(entry.getMimeType())>\n				<div class=\"carousel-item image-viewer-base-image\">\n					<img src=\"${dlUtil.getPreviewURL(entry, entry.getFileVersion(), themeDisplay, \"\")}\" />\n				</div>\n			</#if>\n		</#list>\n	</div>\n\n	<@liferay_aui.script use=\"aui-carousel\">\n		var carousel = new A.Carousel(\n			{\n				after: {\n					responsive: function(event) {\n						event.stopImmediatePropagation();\n\n						var boundingBox = event.currentTarget.get(\'boundingBox\');\n\n						boundingBox.all(\'.image-viewer-base-image-list, .image-viewer-base-image\').setStyles(\n							{\n								height: \'auto\',\n								maxHeight: event.height,\n								maxWidth: event.width,\n								width: \'auto\'\n							}\n						);\n					}\n				},\n\n				contentBox: \'#<@portlet.namespace />carousel\',\n				height: 250,\n				intervalTime: 2,\n				width: 700\n			}\n		).render();\n	</@liferay_aui.script>\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:29.558000'),
(29271,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.660000',	29268,	0,	29269,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Icono</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Pictogram</Name><Name language-id=\"hu_HU\">Ikon</Name><Name language-id=\"pt_BR\">cone</Name><Name language-id=\"de_DE\">Symbol</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Ikoni</Name><Name language-id=\"ca_ES\">Icona</Name><Name language-id=\"fr_FR\">Icne</Name><Name language-id=\"en_US\">Icon</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra el icono de la bandera asociada a cada idioma</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toon het pictogram van de vlag verbonden met iedere taal.</Description><Description language-id=\"hu_HU\">Megjelenti az egyes nyelvekhez kapcsold zszlk ikonjait.</Description><Description language-id=\"pt_BR\">Exibe o cone da bandeira associada a cada idioma.</Description><Description language-id=\"de_DE\">Zeigt Flaggensymbole fr jede Sprache.</Description><Description language-id=\"iw_IL\">       .</Description><Description language-id=\"fi_FI\">Nytt lippuikonin liitettyn jokaiseen kieleen.</Description><Description language-id=\"ca_ES\">Mostra la icona de la bandera associada a cada idioma.</Description><Description language-id=\"fr_FR\">Affiche l\'icne du drapeau associ avec chaque langue.</Description><Description language-id=\"en_US\">Displays the icon of the flag associated with each language.</Description></root>',	'ftl',	'<#if entries?has_content>\n	<#list entries as entry>\n		<#if entry.isSelected()>\n			<#assign cssClass = \"current-language\" />\n		</#if>\n\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"icon\"]\n				cssClass=cssClass\n				image=entry.getW3cLanguageId()?lower_case\n				markupView=\"lexicon\"\n				message=entry.getLongDisplayName()\n				url=entry.getURL()\n			/>\n		</#if>\n	</#list>\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:29.660000'),
(29274,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.729000',	29268,	0,	29272,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Men de iconos</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Pictogram menu</Name><Name language-id=\"hu_HU\">Ikon men</Name><Name language-id=\"pt_BR\">Menu de cones</Name><Name language-id=\"de_DE\">Symbolmen</Name><Name language-id=\"iw_IL\"> </Name><Name language-id=\"fi_FI\">Ikonivalikko</Name><Name language-id=\"ca_ES\">Icona de men</Name><Name language-id=\"fr_FR\">Menu d\'icne</Name><Name language-id=\"en_US\">Icon Menu</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra un men de iconos con los idiomas seleccionados.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toon een pictogram menu met de geselecteerde talen.</Description><Description language-id=\"hu_HU\">Megjelenti az ikon ment a vlasztott nyelveken.</Description><Description language-id=\"pt_BR\">Exibe um menu de cones com os idiomas selecionados.</Description><Description language-id=\"de_DE\">Zeigt ein Symbolmen mit den ausgewhlten Sprachen.</Description><Description language-id=\"iw_IL\">     .</Description><Description language-id=\"fi_FI\">Nytt ikonivalikon, miss on valittuja kieli.</Description><Description language-id=\"ca_ES\">Mostra un men d\'icones amb els idiomes seleccionats.</Description><Description language-id=\"fr_FR\">Affiche un menu d\'icnes avec des langues slectionnes.</Description><Description language-id=\"en_US\">Displays an icon menu with the selected languages.</Description></root>',	'ftl',	'<#if entries?has_content>\n	<div class=\"truncate-text\">\n		<@liferay_ui[\"icon-menu\"]\n			icon=\"../aui/globe\"\n			message=locale.getDisplayName(locale)\n		>\n			<#list entries as entry>\n				<#if !entry.isSelected() && !entry.isDisabled()>\n					<@liferay_ui[\"icon\"]\n						image=\"../language/\" + entry.getLanguageId()\n						label=true\n						lang=entry.getW3cLanguageId()\n						message=entry.getLongDisplayName()\n						url=entry.getURL()\n					/>\n				</#if>\n			</#list>\n		</@>\n	</div>\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:29.729000'),
(29277,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.771000',	29268,	0,	29275,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Texto largo</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Lange tekst</Name><Name language-id=\"hu_HU\">Hossz szveg</Name><Name language-id=\"pt_BR\">Texto Longo</Name><Name language-id=\"de_DE\">Langer Text</Name><Name language-id=\"iw_IL\"> </Name><Name language-id=\"fi_FI\">Pitkteksti</Name><Name language-id=\"ca_ES\">Text llarg</Name><Name language-id=\"fr_FR\">Texte long</Name><Name language-id=\"en_US\">Long Text</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra el nombre completo de cada idioma (ej.: Espaol)</Description><Description language-id=\"ja_JP\">:)</Description><Description language-id=\"nl_NL\">Toon de volledige naam van iedere taal (bv Spaans).</Description><Description language-id=\"hu_HU\">Megjelenti a teljes nevet az egyes nyelvekhez (pl.: spanyol).</Description><Description language-id=\"pt_BR\">Exibe o nome completo de cada idioma (ex.: Espanhol).</Description><Description language-id=\"de_DE\">Zeigt den vollstndigen Namen jeder Sprache (z.B. Spanisch).</Description><Description language-id=\"iw_IL\">       ( ).</Description><Description language-id=\"fi_FI\">Nytt kokonimen joka kielell (esim. suomeksi).</Description><Description language-id=\"ca_ES\">Mostra el nom complet de cada idioma (per exemple, Catal).</Description><Description language-id=\"fr_FR\">Affiche le nom complet de chaque langue (par exemple: Espagnol).</Description><Description language-id=\"en_US\">Displays the full name of each language (e.g. Spanish).</Description></root>',	'ftl',	'<style>\n	.language-entry-long-text {\n		display: inline-block;\n		padding: 0 0.5em;\n	}\n</style>\n\n<#if entries?has_content>\n	<#list entries as entry>\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"a\"]\n				cssClass=\"language-entry-long-text\"\n				href=entry.getURL()\n				label=entry.getLongDisplayName()\n				lang=entry.getW3cLanguageId()\n			/>\n		</#if>\n	</#list>\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:29.771000'),
(29280,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.808000',	29268,	0,	29278,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Caja de seleccin</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Keuze veld</Name><Name language-id=\"hu_HU\">Vlaszt doboz</Name><Name language-id=\"pt_BR\">Caixa de Seleo</Name><Name language-id=\"de_DE\">Auswahlliste</Name><Name language-id=\"iw_IL\"> </Name><Name language-id=\"fi_FI\">Valintalaatikko</Name><Name language-id=\"ca_ES\">Caixa de selecci</Name><Name language-id=\"fr_FR\">Slectionner boite</Name><Name language-id=\"en_US\">Select Box</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra una caja de seleccin con los idiomas seleccionados.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toen keuze veld met de geselecteerde talen.</Description><Description language-id=\"hu_HU\">Megjelenti az ikon ment a vlasztott nyelveken.</Description><Description language-id=\"pt_BR\">Exibe uma caixa de seleo com os idiomas selecionados.</Description><Description language-id=\"de_DE\">Zeigt eine Auswahllist mit den ausgewhlten Sprachen an</Description><Description language-id=\"iw_IL\">     .</Description><Description language-id=\"fi_FI\">Nytt valintalaatikon valituilla kielill.</Description><Description language-id=\"ca_ES\">Mostra un quadre de selecci amb els idiomes seleccionats</Description><Description language-id=\"fr_FR\">Affiche une boite slectionne avec les langues slectionnes.</Description><Description language-id=\"en_US\">Displays a select box with the selected languages</Description></root>',	'ftl',	'<#if entries?has_content>\n	<#assign languageId = localeUtil.toLanguageId(locale) />\n\n	<style>\n		.taglib-language-option {\n			background: none no-repeat 5px center;\n			padding-left: 25px;\n		}\n\n		<#list entries as entry>\n			.taglib-language-option-${entry.getW3cLanguageId()} {\n				background-image: url(${themeDisplay.getPathThemeImages()}/language/${entry.getLanguageId()}.png);\n			}\n		</#list>\n	</style>\n\n	<@liferay_aui[\"form\"]\n		action=formAction\n		method=\"post\"\n		name=\'${namespace + formName}\'\n		useNamespace=false\n	>\n		<@liferay_aui[\"select\"]\n			changesContext=true\n			id=\'${namespace + formName}\'\n			label=\"\"\n			name=\'${name}\'\n			onChange=\'${namespace + \"changeLanguage();\"}\'\n			title=\"language\"\n		>\n			<#list entries as entry>\n				<@liferay_aui[\"option\"]\n					cssClass=\"taglib-language-option taglib-language-option-${entry.getW3cLanguageId()}\"\n					disabled=entry.isDisabled()\n					label=entry.getLongDisplayName()\n					lang=entry.getW3cLanguageId()\n					selected=entry.isSelected()\n					value=entry.getLanguageId()\n				/>\n			</#list>\n		</@>\n	</@>\n\n	<@liferay_aui[\"script\"]>\n		function ${namespace}changeLanguage() {\n			var languageId = AUI.$(document.${namespace + formName}.${name}).val();\n\n			submitForm(document.${namespace + formName});\n		}\n	</@>\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:29.808000'),
(29283,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.856000',	29268,	0,	29281,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Texto corto</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Korte tekst</Name><Name language-id=\"hu_HU\">Rvid szveg</Name><Name language-id=\"pt_BR\">Texto Curto</Name><Name language-id=\"de_DE\">Kurzer Text</Name><Name language-id=\"iw_IL\"> </Name><Name language-id=\"fi_FI\">Lyhytteksti</Name><Name language-id=\"ca_ES\">Text curt</Name><Name language-id=\"fr_FR\">Texte court</Name><Name language-id=\"en_US\">Short Text</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\">ES</Description><Description language-id=\"es_ES\">Muestra una abreviacin de cada idioma (ej.: ES)</Description><Description language-id=\"ja_JP\">:JP)</Description><Description language-id=\"nl_NL\">Toont een afkorting van iedere taal (bijv. SP).</Description><Description language-id=\"hu_HU\">Megjelenti az egyes nyelvek rvidtst (pl.: ES).</Description><Description language-id=\"pt_BR\">Exibe uma abreviao de cada idioma (ex.: ES).</Description><Description language-id=\"de_DE\">Zeigt ein Krzel jeder Sprache (z.B. ES).</Description><Description language-id=\"iw_IL\">     ( ES).</Description><Description language-id=\"fi_FI\">Nytt lyhenteen jokaiselle kielelle (esim. FI)</Description><Description language-id=\"ca_ES\">Mostra una abreviatura de cada idioma (per exemple, CA).</Description><Description language-id=\"fr_FR\">Affiche une abrviation de chaque langue (par exemple ES).</Description><Description language-id=\"en_US\">Displays an abbreviation of each language (e.g. ES).</Description></root>',	'ftl',	'<style>\n	.language-entry-short-text {\n		padding: 0 0.5em;\n	}\n</style>\n\n<#if entries?has_content>\n	<#list entries as entry>\n		<#if !entry.isDisabled()>\n			<@liferay_aui[\"a\"]\n				cssClass=\"language-entry-short-text\"\n				href=entry.getURL()\n				label=entry.getShortDisplayName()\n				lang=entry.getW3cLanguageId()\n			/>\n		</#if>\n	</#list>\n</#if>',	0,	20120,	NULL,	'2018-05-17 14:04:29.856000'),
(29286,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.916000',	20006,	0,	29284,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Mapa</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Kaart</Name><Name language-id=\"hu_HU\">Trkp</Name><Name language-id=\"pt_BR\">Mapa</Name><Name language-id=\"de_DE\">Landkarte</Name><Name language-id=\"iw_IL\"></Name><Name language-id=\"fi_FI\">Kartta</Name><Name language-id=\"ca_ES\">Mapa</Name><Name language-id=\"fr_FR\">Carte</Name><Name language-id=\"en_US\">Map</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra activos geolocalizados en un mapa.</Description><Description language-id=\"ja_JP\"></Description><Description language-id=\"nl_NL\">Toon geolocale content op een kaart.</Description><Description language-id=\"hu_HU\">Megjelenti a fldrajzi tartalmakat egy trkpen.</Description><Description language-id=\"pt_BR\">Exibe os contedos geolocalizados em um mapa.</Description><Description language-id=\"de_DE\">Stellt Assets mit geografischen Informationen in einer Karte dar.</Description><Description language-id=\"iw_IL\">    -   .</Description><Description language-id=\"fi_FI\">Nytt maantieteelliset sisllt kartalla.</Description><Description language-id=\"ca_ES\">Mostra contingut geolocalitzat en un mapa.</Description><Description language-id=\"fr_FR\">Affiche les assets golocaliss dans un plan</Description><Description language-id=\"en_US\">Displays geolocalized assets in a map.</Description></root>',	'ftl',	'<#assign\n	defaultLatitude = -3.6833\n	defaultLongitude = 40.40\n\n	group = themeDisplay.getScopeGroup()\n\n	mapsAPIProvider = group.getLiveParentTypeSettingsProperty(\"mapsAPIProvider\")!\"\"\n\n	companyPortletPreferences = prefsPropsUtil.getPreferences(companyId)\n/>\n\n<#if validator.isNull(mapsAPIProvider)>\n	<#assign mapsAPIProvider = companyPortletPreferences.getValue(\"mapsAPIProvider\", \"Google\") />\n</#if>\n\n<#assign featureCollectionJSONObject = jsonFactoryUtil.createJSONObject() />\n\n<@liferay.silently featureCollectionJSONObject.put(\"type\", \"FeatureCollection\") />\n\n<#assign featureJSONArray = jsonFactoryUtil.createJSONArray() />\n\n<#list entries as entry>\n	<#assign\n		assetRenderer = entry.getAssetRenderer()\n\n		ddmFormValuesReader = assetRenderer.getDDMFormValuesReader()\n\n		ddmFormFieldValues = ddmFormValuesReader.getDDMFormFieldValues(\"ddm-geolocation\")\n\n		coordinatesJSONObjects = []\n	/>\n\n	<#list ddmFormFieldValues as ddmFormFieldValue>\n		<#assign\n			value = ddmFormFieldValue.getValue()\n\n			coordinatesJSONObject = jsonFactoryUtil.createJSONObject(value.getString(locale))\n\n			coordinatesJSONObjects = coordinatesJSONObjects + [coordinatesJSONObject]\n		/>\n	</#list>\n\n	<#list coordinatesJSONObjects as coordinatesJSONObject>\n		<#assign featureJSONObject = jsonFactoryUtil.createJSONObject() />\n\n		<@liferay.silently featureJSONObject.put(\"type\", \"Feature\") />\n\n		<#assign geometryJSONObject = jsonFactoryUtil.createJSONObject() />\n\n		<@liferay.silently geometryJSONObject.put(\"type\", \"Point\") />\n\n		<#assign coordinatesJSONArray = [coordinatesJSONObject.getDouble(\"longitude\"), coordinatesJSONObject.getDouble(\"latitude\")] />\n\n		<@liferay.silently geometryJSONObject.put(\"coordinates\", coordinatesJSONArray) />\n\n		<@liferay.silently featureJSONObject.put(\"geometry\", geometryJSONObject) />\n\n		<#assign propertiesJSONObject = jsonFactoryUtil.createJSONObject() />\n\n		<@liferay.silently propertiesJSONObject.put(\"title\", assetRenderer.getTitle(locale)) />\n\n		<#assign entryAbstract>\n			<@getAbstract asset=entry />\n		</#assign>\n\n		<@liferay.silently propertiesJSONObject.put(\"abstract\", entryAbstract) />\n\n		<#if stringUtil.equals(mapsAPIProvider, \"Google\")>\n			<#assign\n				images = {\n					\"com.liferay.document.library.kernel.model.DLFileEntry\": \"${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/green-dot.png\",\n					\"com.liferay.portlet.dynamicdatalists.model.DDLRecord\": \"${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/red-dot.png\",\n					\"com.liferay.journal.model.JournalArticle\": \"${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/blue-dot.png\",\n					\"default\": \"${themeDisplay.getProtocol()}://maps.google.com/mapfiles/ms/icons/yellow-dot.png\"\n				}\n			/>\n\n			<#if images?keys?seq_contains(entry.getClassName())>\n				<@liferay.silently propertiesJSONObject.put(\"icon\", images[entry.getClassName()]) />\n			<#else>\n				<@liferay.silently propertiesJSONObject.put(\"icon\", images[\"default\"]) />\n			</#if>\n		</#if>\n\n		<@liferay.silently featureJSONObject.put(\"properties\", propertiesJSONObject) />\n\n		<@liferay.silently featureJSONArray.put(featureJSONObject) />\n	</#list>\n</#list>\n\n<@liferay.silently featureCollectionJSONObject.put(\"features\", featureJSONArray) />\n\n<style type=\"text/css\">\n	.asset-entry-abstract {\n		min-width: 400px;\n	}\n\n	.leaflet-popup .asset-entry-abstract {\n		display: inline-block;\n	}\n\n	.asset-entry-abstract .asset-entry-abstract-image {\n		display: block;\n		float: left;\n		height: 128px;\n		margin-right: 1em;\n		text-align: center;\n	}\n\n	.asset-entry-abstract .asset-entry-abstract-image img {\n		display: block;\n		margin: 0 auto;\n		max-height: 100%;\n	}\n\n	.asset-entry-abstract .taglib-icon {\n		float: right;\n	}\n</style>\n\n<@liferay_map[\"map-display\"]\n	name=\'Map\'\n	points=\"${featureCollectionJSONObject}\"\n/>\n\n<@liferay_aui.script use=\"liferay-map-base\">\n	var map = Liferay.component(\'<@portlet.namespace />Map\');\n\n	map.on(\n		\'featureClick\',\n		function(event) {\n			var feature = event.feature;\n\n			map.openDialog(\n				{\n					content: feature.getProperty(\'abstract\'),\n					marker: feature.getMarker(),\n					position: feature.getGeometry().get(\'location\')\n				}\n			);\n		}\n	);\n</@liferay_aui.script>\n\n<#macro getAbstract asset>\n	<div class=\"asset-entry-abstract\" id=\"<@portlet.namespace />assetEntryAbstract\">\n		<#assign\n			showEditURL = paramUtil.getBoolean(renderRequest, \"showEditURL\", true)\n\n			assetRenderer = asset.getAssetRenderer()\n		/>\n\n		<#if showEditURL && assetRenderer.hasEditPermission(permissionChecker)>\n			<#assign redirectURL = renderResponse.createLiferayPortletURL(themeDisplay.getPlid(), themeDisplay.getPortletDisplay().getId(), \"RENDER_PHASE\", false) />\n\n			${redirectURL.setParameter(\"mvcPath\", \"/add_asset_redirect.jsp\")}\n\n			<#assign\n				editPortletURL = assetRenderer.getURLEdit(renderRequest, renderResponse, windowStateFactory.getWindowState(\"POP_UP\"), redirectURL)\n\n				taglibEditURL = \"javascript:Liferay.Util.openWindow({id: \'\" + renderResponse.getNamespace() + \"editAsset\', title: \'\" + htmlUtil.escapeJS(languageUtil.format(locale, \"edit-x\", htmlUtil.escape(assetRenderer.getTitle(locale)), false)) + \"\', uri:\'\" + htmlUtil.escapeJS(editPortletURL.toString()) + \"\'});\"\n			/>\n\n			<@liferay_ui.icon\n				image=\"edit\"\n				label=true\n				message=\"edit\"\n				url=taglibEditURL\n			/>\n		</#if>\n\n		<#if assetRenderer.getThumbnailPath(renderRequest)??>\n			<div class=\"asset-entry-abstract-image\">\n				<img src=\"${assetRenderer.getThumbnailPath(renderRequest)}\" />\n			</div>\n		</#if>\n\n		<#assign assetURL = assetPublisherHelper.getAssetViewURL(renderRequest, renderResponse, assetRenderer, asset, false) />\n\n		<div class=\"asset-entry-abstract-content\">\n			<h3><a href=\"${assetURL}\">${assetRenderer.getTitle(locale)}</a></h3>\n\n			<div>\n				${assetRenderer.getSummary(renderRequest, renderResponse)}\n			</div>\n		</div>\n\n		<div class=\"asset-entry-abstract-footer\">\n			<a href=\"${assetURL}\">${languageUtil.get(locale, \"read-more\")} &raquo;</a>\n		</div>\n	</div>\n</#macro>',	0,	20120,	NULL,	'2018-05-17 14:04:29.916000'),
(29289,	20152,	20116,	20120,	NULL,	'2018-05-17 14:04:29.950000',	20006,	0,	29287,	'1.0',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Name language-id=\"zh_CN\"></Name><Name language-id=\"es_ES\">Resumen completo</Name><Name language-id=\"ja_JP\"></Name><Name language-id=\"nl_NL\">Rijke samenvatting</Name><Name language-id=\"hu_HU\">B sszest</Name><Name language-id=\"pt_BR\">Sumrio Rico</Name><Name language-id=\"de_DE\">Rich-Text-Zusammenfassung</Name><Name language-id=\"iw_IL\"> </Name><Name language-id=\"fi_FI\">Muotoiltu yhteenveto</Name><Name language-id=\"ca_ES\">Resum enriquit</Name><Name language-id=\"fr_FR\">Sommaire enrichi</Name><Name language-id=\"en_US\">Rich Summary</Name></root>',	'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US,zh_CN,es_ES,ja_JP,nl_NL,hu_HU,pt_BR,de_DE,iw_IL,fi_FI,ca_ES,fr_FR,\" default-locale=\"en_US\"><Description language-id=\"zh_CN\"></Description><Description language-id=\"es_ES\">Muestra abstractos, iconos, activos relacionados e imprime/edita acciones para activos. Opcionalmente incluye marcadores de activos y calificaciones.</Description><Description language-id=\"ja_JP\">/</Description><Description language-id=\"nl_NL\">Toon samenvattingen, pictogrammen, gerelateerde content en afdruk en bewerk acties voor content. Voeg optioneel bladwijzers en beoordelingen toe.</Description><Description language-id=\"hu_HU\">Megjelenti a kivonatokat, ikonokat, a kapcsold tartalmakat, s a nyomtatsi/szerkesztsi mveleteket a tarlamakhoz. Opcionlisan tartalmazza a tartalom knyvjelzket s rtkelseket.</Description><Description language-id=\"pt_BR\">Exibe abstracts, cones, contedos relacionados e aes de imprimir/editar para os contedos. Opcionalmente, inclui marcadores e classificaes de contedos.</Description><Description language-id=\"de_DE\">Stellt Kurzfassungen, Icons, verwandte Assets sowie Druck- und Bearbeitungsoptionen fr Assets dar. Kann auch Bookmarks und Bewertungen enthalten.</Description><Description language-id=\"iw_IL\"> , ,    /  .     .</Description><Description language-id=\"fi_FI\">Nytt lyhenteet, kuvakkeet, liittyvt sisllt ja sisltjen tulosta/muokkaa toiminnot. Voit ottaa mukaan mys sisltjen kirjanmerkit ja arvostelut.</Description><Description language-id=\"ca_ES\">Mostra resums, icones, continguts relacionats i accions d\'impressi o edici per continguts. Opcionalment, inclou enllaos i valoracions.</Description><Description language-id=\"fr_FR\">Affiche les rsums, icons, les assets relatifs, et les actions imprimer/diter pour les assets. Facultativement inclut les signets et les notations d\'assets.</Description><Description language-id=\"en_US\">Displays abstracts, icons, related assets, and print/edit actions for assets. Optionally include asset bookmarks and ratings.</Description></root>',	'ftl',	'<#if !entries?has_content>\n	<#if !themeDisplay.isSignedIn()>\n		${renderRequest.setAttribute(\"PORTLET_CONFIGURATOR_VISIBILITY\", true)}\n	</#if>\n\n	<div class=\"alert alert-info\">\n		<@liferay_ui[\"message\"] key=\"there-are-no-results\" />\n	</div>\n</#if>\n\n<#list entries as entry>\n	<#assign\n		entry = entry\n\n		assetRenderer = entry.getAssetRenderer()\n\n		entryTitle = htmlUtil.escape(assetRenderer.getTitle(locale))\n\n		viewURL = assetPublisherHelper.getAssetViewURL(renderRequest, renderResponse, assetRenderer, entry, !stringUtil.equals(assetLinkBehavior, \"showFullContent\"))\n	/>\n\n	<div class=\"asset-abstract\">\n		<div class=\"pull-right\">\n			<@getPrintIcon />\n\n			<@getFlagsIcon />\n\n			<@getEditIcon />\n		</div>\n\n		<h3 class=\"asset-title\">\n			<a href=\"${viewURL}\">\n				${entryTitle}\n			</a>\n		</h3>\n\n		<@getMetadataField fieldName=\"tags\" />\n\n		<@getMetadataField fieldName=\"create-date\" />\n\n		<@getMetadataField fieldName=\"view-count\" />\n\n		<div class=\"asset-content\">\n			<@getSocialBookmarks />\n\n			<div class=\"asset-summary\">\n				<@getMetadataField fieldName=\"author\" />\n\n				${htmlUtil.escape(assetRenderer.getSummary(renderRequest, renderResponse))}\n\n				<a href=\"${viewURL}\"><@liferay.language key=\"read-more\" /><span class=\"hide-accessible\"><@liferay.language key=\"about\" />${entryTitle}</span> &raquo;</a>\n			</div>\n\n			<@getRatings />\n\n			<@getRelatedAssets />\n\n			<@getDiscussion />\n		</div>\n	</div>\n</#list>\n\n<#macro getDiscussion>\n	<#if getterUtil.getBoolean(enableComments) && assetRenderer.isCommentable()>\n		<br />\n\n		<#assign discussionURL = renderResponse.createActionURL() />\n\n		${discussionURL.setParameter(\"javax.portlet.action\", \"invokeTaglibDiscussion\")}\n\n		<@liferay_ui[\"discussion\"]\n			className=entry.getClassName()\n			classPK=entry.getClassPK()\n			formAction=discussionURL?string\n			formName=\"fm\" + entry.getClassPK()\n			ratingsEnabled=getterUtil.getBoolean(enableCommentRatings)\n			redirect=currentURL\n			userId=assetRenderer.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getEditIcon>\n	<#if assetRenderer.hasEditPermission(themeDisplay.getPermissionChecker())>\n		<#assign redirectURL = renderResponse.createRenderURL() />\n\n		${redirectURL.setParameter(\"mvcPath\", \"/add_asset_redirect.jsp\")}\n		${redirectURL.setWindowState(\"pop_up\")}\n\n		<#assign editPortletURL = assetRenderer.getURLEdit(renderRequest, renderResponse, windowStateFactory.getWindowState(\"pop_up\"), redirectURL)!\"\" />\n\n		<#if validator.isNotNull(editPortletURL)>\n			<#assign title = languageUtil.format(locale, \"edit-x\", entryTitle, false) />\n\n			<@liferay_ui[\"icon\"]\n				cssClass=\"icon-monospaced visible-interaction\"\n				icon=\"pencil\"\n				markupView=\"lexicon\"\n				message=title\n				url=\"javascript:Liferay.Util.openWindow({id:\'\" + renderResponse.getNamespace() + \"editAsset\', title: \'\" + title + \"\', uri:\'\" + htmlUtil.escapeURL(editPortletURL.toString()) + \"\'});\"\n			/>\n		</#if>\n	</#if>\n</#macro>\n\n<#macro getFlagsIcon>\n	<#if getterUtil.getBoolean(enableFlags)>\n		<@liferay_flags[\"flags\"]\n			className=entry.getClassName()\n			classPK=entry.getClassPK()\n			contentTitle=entry.getTitle(locale)\n			label=false\n			reportedUserId=entry.getUserId()\n		/>\n	</#if>\n</#macro>\n\n<#macro getMetadataField\n	fieldName\n>\n	<#if stringUtil.split(metadataFields)?seq_contains(fieldName)>\n		<span class=\"metadata-entry metadata-${fieldName}\">\n			<#assign dateFormat = \"dd MMM yyyy - HH:mm:ss\" />\n\n			<#if stringUtil.equals(fieldName, \"author\")>\n				<@liferay.language key=\"by\" /> ${htmlUtil.escape(portalUtil.getUserName(assetRenderer.getUserId(), assetRenderer.getUserName()))}\n			<#elseif stringUtil.equals(fieldName, \"categories\")>\n				<@liferay_ui[\"asset-categories-summary\"]\n					className=entry.getClassName()\n					classPK=entry.getClassPK()\n					portletURL=renderResponse.createRenderURL()\n				/>\n			<#elseif stringUtil.equals(fieldName, \"create-date\")>\n				${dateUtil.getDate(entry.getCreateDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"expiration-date\")>\n				${dateUtil.getDate(entry.getExpirationDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"modified-date\")>\n				${dateUtil.getDate(entry.getModifiedDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"priority\")>\n				${entry.getPriority()}\n			<#elseif stringUtil.equals(fieldName, \"publish-date\")>\n				${dateUtil.getDate(entry.getPublishDate(), dateFormat, locale)}\n			<#elseif stringUtil.equals(fieldName, \"tags\")>\n				<@liferay_ui[\"asset-tags-summary\"]\n					className=entry.getClassName()\n					classPK=entry.getClassPK()\n					portletURL=renderResponse.createRenderURL()\n				/>\n			<#elseif stringUtil.equals(fieldName, \"view-count\")>\n				${entry.getViewCount()} <@liferay.language key=\"views\" />\n			</#if>\n		</span>\n	</#if>\n</#macro>\n\n<#macro getPrintIcon>\n	<#if getterUtil.getBoolean(enablePrint)>\n		<#assign printURL = renderResponse.createRenderURL() />\n\n		${printURL.setParameter(\"mvcPath\", \"/view_content.jsp\")}\n		${printURL.setParameter(\"assetEntryId\", entry.getEntryId()?string)}\n		${printURL.setParameter(\"viewMode\", \"print\")}\n		${printURL.setParameter(\"type\", entry.getAssetRendererFactory().getType())}\n\n		<#if assetRenderer.getUrlTitle()?? && validator.isNotNull(assetRenderer.getUrlTitle())>\n			<#if assetRenderer.getGroupId() != themeDisplay.getScopeGroupId()>\n				${printURL.setParameter(\"groupId\", assetRenderer.getGroupId()?string)}\n			</#if>\n\n			${printURL.setParameter(\"urlTitle\", assetRenderer.getUrlTitle())}\n		</#if>\n\n		${printURL.setWindowState(\"pop_up\")}\n\n		<@liferay_ui[\"icon\"]\n			iconCssClass=\"icon-print\"\n			message=\"print\"\n			url=\"javascript:Liferay.Util.openWindow({id:\'\" + renderResponse.getNamespace() + \"printAsset\', title: \'\" + languageUtil.format(locale, \"print-x-x\", [\"hide-accessible\", entryTitle], false) + \"\', uri: \'\" + htmlUtil.escapeURL(printURL.toString()) + \"\'});\"\n		/>\n	</#if>\n</#macro>\n\n<#macro getRatings>\n	<#if getterUtil.getBoolean(enableRatings) && assetRenderer.isRatable()>\n		<div class=\"asset-ratings\">\n			<@liferay_ui[\"ratings\"]\n				className=entry.getClassName()\n				classPK=entry.getClassPK()\n			/>\n		</div>\n	</#if>\n</#macro>\n\n<#macro getRelatedAssets>\n	<#if getterUtil.getBoolean(enableRelatedAssets)>\n		<@liferay_ui[\"asset-links\"] assetEntryId=entry.getEntryId() />\n	</#if>\n</#macro>\n\n<#macro getSocialBookmarks>\n	<#if getterUtil.getBoolean(enableSocialBookmarks)>\n		<@liferay_ui[\"social-bookmarks\"]\n			displayStyle=\"${socialBookmarksDisplayStyle}\"\n			target=\"_blank\"\n			title=entry.getTitle(locale)\n			url=viewURL\n		/>\n	</#if>\n</#macro>',	0,	20120,	NULL,	'2018-05-17 14:04:29.950000'),
