INSERT INTO `marketplace_app` (`uuid_`, `appId`, `companyId`, `userId`, `userName`, `createDate`, `modifiedDate`, `remoteAppId`, `title`, `description`, `category`, `iconURL`, `version`, `required`) VALUES
('18f5e37c-4600-f635-387c-3cdb6e832bfd',	29604,	20116,	0,	NULL,	'2018-05-17 14:04:34.821000',	'2018-05-17 14:04:34.821000',	15098914,	'Liferay Documentum Connector',	'You can use this hook to integrate Liferay and its Documents and Media functionality with Documentum. Before configuring Documentum, you must install this app. To use this hook, set dl.hook.impl=liferay.documentum.hook.DocumentumHook. If you are using Documentum, there are additional settings that must be configured in the ${liferay_home}/documentum-hook/docroot/WEB-INF/src/dfc.properties and documentum-hook/docroot/WEB-INF/src/portlet.properties files. This app installs as a new Repository Type option in the Documents and Media Library.',	'Productivity',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/94855250',	'3.0.2',	0),
('1cfdf803-a03a-5467-9635-4f96291c3ab0',	29606,	20116,	0,	NULL,	'2018-05-17 14:04:34.901000',	'2018-05-17 14:04:34.901000',	74860500,	'Liferay Static',	'The Static app contains an important group of extenders and utilities that Liferay statically installs before installing any dynamic OSGi modules. The app\'s functionality includes a log4j extender, an OSGi WAB extender, configuration utilities, OSGi deployment utilities, target platform indexing, and more.This suite is available in the Liferay bundle.',	'Utility',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/96226664',	'7.0.35',	1),
('eb5840d3-7730-b415-9933-0b0c8e0c9778',	29646,	20116,	0,	NULL,	'2018-05-17 14:04:35.890000',	'2018-05-17 14:04:35.890000',	74593955,	'Liferay Foundation',	'Apps and Features: System Settings, Web Content Editors, Web Content Template Languages, Theme Tools, Mobile Device Rules, Facebook Authentication, LDAP Authentication, NTLM Authentication, OpenID Authentication, OpenSSO Authentication, Remote Authentication (AuthVerifiers), SSO-based Authentication, Token-based Authentication, Portal Scripting, Elasticsearch Support, Solr Support, Documents and Media Store Implementations, and more.The Foundation suite provides applications and features that extend the functionality provided by Liferay\'s core. Much of the functionality that belonged to Liferay\'s core prior to Liferay 7 has been extracted into the modules of the Foundation suite. The authentication modules provide a variety of mechanisms for allowing users and remote applications to authenticate to Liferay. The LDAP Authentication module allows administrators to establish connections to one or more LDAP directories from which users can be imported or exported. The SSO modules allow users to authenticate to Liferay using a variety of single-sign on solutions. The Token-based Authentication module allows users or remote applications to authenticate to Liferay without a password. The Scripting modules allow scripts to be written to invoke Liferay\'s API in several languages including Groovy, Beanshell, Python, Ruby, and JavaScript.This suite is available in the Liferay bundle.',	'Utility',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/96228291',	'7.0.34',	1),
('3e8cb795-a31e-ca34-33f0-2d732f1cb206',	29854,	20116,	0,	NULL,	'2018-05-17 14:04:41.231000',	'2018-05-17 14:04:41.231000',	74593617,	'Liferay Collaboration',	'The Liferay Collaboration suite provides applications and features that help users share ideas, implement them, and produce terrific results. Its apps such as Message Boards and Blogs help users start discussions, ask questions, share ideas, and connect with other users. Wiki allows users to share in-depth information. And Alerts and Announcements facilitate broadcasting information and notifications.As users collaborate, they\'re sure to produce important files. The suite\'s Documents and Media Library allows users to store files, share them, and publish them. It not only works with Liferay\'s built-in repository but also allows you to integrate with external repositories, such CMIS repositories. Users can add and share all kinds of files, including documents, presentations, images, and videos. And the suite\'s Documents and Media app and Media Gallery help users display files the way they like them.As users engage in site activities, you\'ll want to recognize them and connect them with other users. The suite\'s social networking apps and features enable you to attribute social equity to active users automatically by increasing their rank on the site. You can even highlight user activities to show your site\'s liveliness. The Mentions feature facilitates notifying specific users in the context of site content, discussions, and comments. The social apps also help users share their thoughts on the your sites and other social sites, such as Facebook and Twitter. Combined with the suite\'s collaboration and document management features, the Collaboration suites social features help develop awesome communities, foster high morale, and make work interesting.Apps and Features: Activities, Alerts, Announcements, Blogs, Bookmarks, Comments, Friends/My Sites/Portal/Site Members Directory, Documents and Media, Friend Requests, Image Uploader, Invite Members, Media Gallery, Message Boards, Mentions, Microblogs, Page Flags/Comments/Ratings, Quick Note, Requests, Social Activity, User/Group Statistics, Wiki.This suite may contain modules that depend on Foundation suite modules. This suite is available in the Liferay bundle.',	'Communication',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/96226363',	'7.0.32',	1),
('0867c836-0260-9217-225e-2f1ffc8536fb',	29937,	20116,	0,	NULL,	'2018-05-17 14:04:43.260000',	'2018-05-17 14:04:43.260000',	74593865,	'Liferay Forms and Workflow',	'Apps and Features: Calendar, Dynamic Data Lists, Dynamic Data Mapping, Forms, Polls, WorkflowAn increase in productivity means you\'re saving time and effort; youre becoming more efficient. The Forms and Workflow apps help you do that by giving you built-in calendars and the ability to create your own forms and list applications. These are powerful, flexible apps that can be quickly leveraged for basic tasks, or carefully configured and mastered to perfect business processes.Need a quick survey or complex Sign Up form? Use the Liferay Forms app and make any forms you want. If there\'s a forms feature you need, this app probably has it.Maybe you need an entire list application, and you need it today. Dynamic Data Lists lets you do it without any developer expertise.Do you need personal calendars for your users, and/or site calendars? Do you need the calendar to be highly configurable? Use the Calendar app.Would you like to initiate a review process when new content, or any new asset, is created? The Kaleo Workflow Engine lets you send any asset through review before it gets published.Want to quickly get the opinion of your users on something? The Polls app is extremely easy to use. This suite may contain modules that depend on Foundation suite modules. This suite is available in the Liferay bundle.',	'Productivity',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/96225183',	'7.0.32',	1),
('72f1e26c-f4e7-b104-1bfb-7786e6a26114',	29999,	20116,	0,	NULL,	'2018-05-17 14:04:44.723000',	'2018-05-17 14:04:44.723000',	45261909,	'Liferay OAuth Provider',	'The OAuth app authorizes third-party applications to interact with a Liferay user\'s applications. OAuth is a \"handshake mechanism\" that redirects Liferay users to a service provider, where they can tell the service provider to allow a plugin limited access to their Liferay accounts. This keeps the plugin from storing any of the user\'s credentials, avoiding security risks. The OAuth app provides two portlets that allow for registering a plugin for OAuth and authorizing OAuth users, respectively. Once the plugin is registered for OAuth and accessed, the user is redirected to the service provider to delegate user authentication.This app will appear in your Control Panel and My Account menu.',	'Security',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/77134116',	'3.0.0',	0),
('30c3288d-e53f-3d0a-ae07-df0a12a08e77',	30003,	20116,	0,	NULL,	'2018-05-17 14:04:44.829000',	'2018-05-17 14:04:44.829000',	25019275,	'Liferay Marketplace',	'Liferay Marketplace is an integral part of the Liferay platform experience for all users. Enterprise subscribers also have exclusive access to Liferay Subscription Apps through the Liferay Marketplace. Log in with your Liferay account to browse hundreds of apps to help you build your business or technical solution.',	'Utility',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/90760637',	'9',	1),
('10b229ac-de2d-0d37-3f4d-57ca682eb5d9',	30009,	20116,	0,	NULL,	'2018-05-17 14:04:44.954000',	'2018-05-17 14:04:44.954000',	71774947,	'Liferay Connected Services Client',	'The Liferay Connected Services app connects your Liferay instance to Liferay Connected Services (LCS). LCS is an online service that offers fix pack management, server metrics, Liferay subscription management, and more. LCS provides single-click download and install of fix packs, even across a cluster. The server metrics service provides information on how your Liferay instance is running. This includes data on pages, portlets, memory usage, JVM performance, and more. Note that the fix pack and subscription management features require an active Liferay subscription.In order to offer the best service possible, we store the following information about your servers on the LCS servers: patches installed on each server, portal.properties (except sensitive data), JVM metrics, portal and portlet metrics, cache and server metrics. Sensitive data is defined as any key-value pair containing usernames or passwords.This app will appear in your Control Panel once installed.Liferay Connected Services Client requires the installation of the Liferay Portal 6.2 EE SP15+.',	'Utility',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/93128485',	'4.0.2',	0),
('e53670f0-4ee1-2768-621e-acb6a194b890',	30011,	20116,	0,	NULL,	'2018-05-17 14:04:45.018000',	'2018-05-17 14:04:45.018000',	74594163,	'Liferay Web Experience',	'Apps and Features: Application Display Templates, Asset Publisher, Breadcrumb, Categories, Google Analytics, IFrame, Language, Navigation, Recycle Bin, Related Content, RSS, Search, Site and Page Templates, Sitemap, Sites Directory, Tags, Web Content, XSL ContentThe Web Experience suite provides features that help create, manage, and track content. The Web Content app lets you express your ideas and plans by creating dynamic content that can be structured to fit a specific design. You can also use templates to design web content for an appealing look and feel. Templates can be used in other realms of Liferay besides web content too. Site and Page Templates let you reproduce sites and pages that have been organized to address specific needs. Application Display Templates are another type of Liferay template that lets you develop the look and feel of applications. The IFrame and XSL Content apps let you create other forms of content by embedding HTML and XSL content on a site page.As administrators create content, organization is critical to keeping things tidy in your site. The suite\'s Tags and Categories apps lets you organize your web content to follow an organizational hierarchy. These organizational apps also aid with Liferay\'s Search app, which you can utilize to dynamically search content you\'ve created. The suite\'s Navigation, Breadcrumb, Sitemap, and Sites Directory apps aid in Liferay\'s organizational structure, providing a top level view of sites and their pages that have been created. To promote content in an organized way, the Asset Publisher and Related Assets apps broadcast assets and their related information. Inevitably, some content you create becomes stale and requires removal; the Recycle Bin app lets you delete content, with the option to restore that content.As a site accumulates content, administrators should have a way to easily track their content. The Google Analytics app allows the use of Google\'s tool set for analyzing site traffic data. The suite\'s RSS app provides a web feed used to publish updated works such as blog entries and news articles. The suite\'s Language app provides a way to change Liferay\'s language to cater to your site\'s international audience. This suite\'s content creation and organization focus lets site administrators develop dynamic content, organize content for easy managing, and track content for ideas to better improve the content creation process in the future.This suite may contain modules that depend on Foundation suite modules. This suite is available in the Liferay bundle.',	'Productivity',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/96226794',	'7.0.34',	1),
('96ac87ac-b9a9-c2b8-f0c7-035baeb7995c',	30128,	20116,	0,	NULL,	'2018-05-17 14:04:47.707000',	'2018-05-17 14:04:47.707000',	15188537,	'Liferay Sharepoint Connector',	'The SharePoint Connector app lets users interact with files in SharePoint libraries from within a Liferay Documents and Media library. This app makes available in the Documents and Media Library a SharePoint repository type for mounting SharePoint libraries. Within such a repository, users can view, add, modify, and move files and folders. The app propagates actions performed in the SharePoint library to the SharePoint repository in the Liferay Documents and Media Library, and vice versa.Here are some of the app\'s capabilities:* Reading/writing documents and folders* Document check-in, check-out, and undo check-out* Downloading documents* Moving folders and documents within the repository* Getting revision history* Reverting to a revisionThe current version of the app requires Liferay DXP Digital Enterprise 7.0+ and works with both SharePoint 2013 and SharePoint 2010.Connect your Liferay Digital Experience Platform with your SharePoint libraries today!The current version of this app depends on modules in the Liferay Collaboration App Suite and the Liferay Foundation App Suite.',	'Utility',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/77084635',	'3.0.3',	0),
('02e5fa28-c8c3-00ad-08c0-ffab3c871512',	30130,	20116,	0,	NULL,	'2018-05-17 14:04:47.752000',	'2018-05-17 14:04:47.752000',	15100579,	'Liferay IP Geocoder',	'The IP Geocoder app uses Max Mind\'s GeoIP City Database to locate your geological position, often in conjunction with other apps like the Google Maps app. IP geolocation can be performed by associating a geographic location with the user\'s Internet Protocol (IP) address. Geolocation usually works by automatically looking up an IP address on a WHOIS service and retrieving the registrant\'s geographic location.This app will appear in your Applications menu once installed.',	'Utility',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/92609700',	'3.0.1',	0),
('bd605e69-d908-b5b3-9275-31ed4df6f340',	30135,	20116,	0,	NULL,	'2018-05-17 14:04:47.865000',	'2018-05-17 14:04:47.865000',	31709100,	'Liferay Sync Connector',	'Liferay Sync Connector 4.1.1 requires the installation of the Liferay Digital Enterprise 7.0 Fix Pack 19 or higher.The Sync Connector app lets users connect to their portals from the Liferay Sync desktop and mobile clients. It also lets administrators control how these clients interact with their portal. Once installed, the Sync Connector app provides the portal services required by the clients. No additional portal configuration is required. However, portal administrators can use the Sync Admin portlet installed with this app to control what sites are available for Sync. They can also use this portlet to disable Sync across the portal.After installing, the Sync Admin portlet is available in the Control Panels Configuration section.Please visit http://www.liferay.com/products/liferay-sync/features for more information on downloading the Liferay Sync desktop and mobile clients. Liferay Sync is compatible with Windows, Mac OS, iOS, and Android. The Sync Connector app requires version 3.0+ of the Sync desktop or mobile client, as well as the IP Geocoder and OAuth Provider apps.',	'Productivity',	'https://web.liferay.com/web/guest/marketplace/-/mp/asset/icon/91191843',	'4.1.1',	0);
